Verenigde Staten
Fantasy / Avontuur
107 minuten

een mooie film

met Freddie Highmore, David Strathairn en Mary-Louise Parker

De tweelingbroers Jared en Simon verhuizen samen met hun moeder en zus Mallory naar het oude landhuis van hun tante, Villa 
Spiderwick. Daar ontdekken de kinderen al snel een geheime bibliotheek, waar ze een mysterieus boek vinden. Ze maken ook kennis 
met een kobold die in het huis woont en die de kinderen het leven zuur maakt. Deze kobold waarschuwt de kinderen wel het boek 
dat ze gevonden hebben te verbranden, want anders zouden zij weleens in grote problemen kunnen komen. Zijn waarschuwing lijkt 
echter te laat te komen...
